import React from 'react';
import dancer_gif from '../pics/dance_shark.gif';

class Fella extends React.Component {
  render() {
    const style = {
      position: "fixed",
      right: "-4em",
      bottom: "0",
      height: "20%"
    }
    return <img style={style} src={dancer_gif} alt="gif of shark dancing" />;
  }
}

export default Fella;
